// import React, { useRef } from 'react';
import {Route, Routes } from 'react-router-dom';
import MatchSummary from './components/MatchSummary';
import PlayerPerformance from './components/PlayerPerformance';
import Chatbot from './components/Chatbot';
import VirtualAssistant from './components/VirtualAssistant';
import VirtualCommentator from './components/VirtualCommentator';
// import FocusInput from './components/FocusInput';
import './App.css';
import Navbar from './components/Navbar';

function App() {
  return (

      <div className="App">
          <Navbar/>
          <Routes>
          <Route path="/" component={Navbar} /> 
          <Route path="/match-summary" component={MatchSummary} />
          <Route path="/player-performance" component={PlayerPerformance} />
          <Route path="/chatbot" component={Chatbot} />
          <Route path="/virtual-assistant" component={VirtualAssistant} />
          <Route path="/virtual-commentator" component={VirtualCommentator} />
          {/* <Route path="/FocusInput" component={FocusInput} /> */}
        </Routes>

      </div>

  );
}

export default App;
